import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';
import styled from 'styled-components';
import { Trophy, Target, Clock, FileText, Home, RotateCcw, CheckCircle, XCircle } from 'lucide-react';

const Container = styled(motion.div)`
  min-height: 100vh;
  padding: 2rem;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const ResultsCard = styled(motion.div)`
  background: rgba(255, 255, 255, 0.95);
  backdrop-filter: blur(15px);
  border-radius: 25px;
  padding: 3rem;
  box-shadow: 0 25px 50px rgba(0, 0, 0, 0.1);
  border: 1px solid rgba(255, 255, 255, 0.2);
  max-width: 1000px;
  width: 100%;
`;

const Header = styled.div`
  text-align: center;
  margin-bottom: 3rem;
`;

const ScoreCircle = styled(motion.div)`
  width: 200px;
  height: 200px;
  border-radius: 50%;
  background: ${props => props.grade >= 80 ? 
    'linear-gradient(135deg, #10b981 0%, #059669 100%)' :
    props.grade >= 60 ?
    'linear-gradient(135deg, #f59e0b 0%, #d97706 100%)' :
    'linear-gradient(135deg, #ef4444 0%, #dc2626 100%)'
  };
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  margin: 0 auto 2rem;
  color: white;
  box-shadow: 0 15px 30px rgba(0, 0, 0, 0.2);
`;

const ScoreText = styled.div`
  font-size: 3rem;
  font-weight: 700;
`;

const ScoreSubtext = styled.div`
  font-size: 1.2rem;
  opacity: 0.9;
`;

const Title = styled.h1`
  font-size: 2.5rem;
  font-weight: 700;
  color: #333;
  margin-bottom: 1rem;
`;

const Subtitle = styled.p`
  font-size: 1.2rem;
  color: #666;
  margin-bottom: 2rem;
`;

const StatsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 1.5rem;
  margin-bottom: 3rem;
