const Results = () => {
  const location = useLocation();
  const navigate = useNavigate();

  const {
    quiz,
    userAnswers,
    totalQuestions,
    correctAnswers,
    timeElapsed,
    metadata
  } = location.state || {};

  if (!quiz || !userAnswers) {
    navigate('/');
    return null;
  }

  const percentage = Math.round((correctAnswers / totalQuestions) * 100);
  const grade = percentage >= 80 ? 'Excellent' : percentage >= 60 ? 'Good' : 'Needs Improvement';

  const formatTime = (seconds) => {
    const mins = Math.floor(seconds / 60);
    const secs = seconds % 60;
    return `${mins}:${secs.toString().padStart(2, '0')}`;
  };

  const getGradeColor = () => {
    if (percentage >= 80) return '#10b981';
    if (percentage >= 60) return '#f59e0b';
    return '#ef4444';
  };

  return (
    <Container
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.5 }}
    >
      <ResultsCard
        initial={{ y: 50, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        transition={{ duration: 0.6, delay: 0.2 }}
      >
        <Header>
          <ScoreCircle
            grade={percentage}
            initial={{ scale: 0, rotate: -180 }}
            animate={{ scale: 1, rotate: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            <ScoreText>{percentage}%</ScoreText>
            <ScoreSubtext>{grade}</ScoreSubtext>
          </ScoreCircle>

          <Title>Quiz Complete!</Title>
          <Subtitle>
            You answered {correctAnswers} out of {totalQuestions} questions correctly
          </Subtitle>
        </Header>

        <StatsGrid>
          <StatCard
            initial={{ x: -50, opacity: 0 }}
            animate={{ x: 0, opacity: 1 }}
            transition={{ duration: 0.6, delay: 0.6 }}
          >
            <StatIcon color="#667eea">
              <Target size={24} />
            </StatIcon>
            <StatContent>
              <StatValue>{correctAnswers}/{totalQuestions}</StatValue>
              <StatLabel>Correct Answers</StatLabel>
            </StatContent>
          </StatCard>

          <StatCard
            initial={{ x: -50, opacity: 0 }}
            animate={{ x: 0, opacity: 1 }}
            transition={{ duration: 0.6, delay: 0.7 }}
          >
            <StatIcon color="#10b981">
              <Trophy size={24} />
            </StatIcon>
            <StatContent>
              <StatValue>{percentage}%</StatValue>
              <StatLabel>Score</StatLabel>
            </StatContent>
          </StatCard>

          <StatCard
            initial={{ x: -50, opacity: 0 }}
            animate={{ x: 0, opacity: 1 }}
            transition={{ duration: 0.6, delay: 0.8 }}
          >
            <StatIcon color="#f59e0b">
              <Clock size={24} />
            </StatIcon>
            <StatContent>
              <StatValue>{formatTime(timeElapsed)}</StatValue>
              <StatLabel>Time Taken</StatLabel>
            </StatContent>
          </StatCard>

          <StatCard
            initial={{ x: -50, opacity: 0 }}
            animate={{ x: 0, opacity: 1 }}
            transition={{ duration: 0.6, delay: 0.9 }}
          >
            <StatIcon color="#8b5cf6">
              <FileText size={24} />
            </StatIcon>
            <StatContent>
              <StatValue>{quiz.difficulty.toUpperCase()}</StatValue>
              <StatLabel>Difficulty</StatLabel>
            </StatContent>
          </StatCard>
        </StatsGrid>

        <QuestionReview>
          <ReviewTitle>
            <FileText size={24} />
            Question Review
          </ReviewTitle>

          {quiz.questions.map((question, index) => {
            const userAnswer = userAnswers[index];
            const isCorrect = userAnswer === question.correctAnswer;

            return (
              <QuestionItem
                key={question.id}
                isCorrect={isCorrect}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: 1 + (index * 0.1) }}
              >
                <QuestionHeader>
                  <QuestionText>
                    {index + 1}. {question.question}
                  </QuestionText>
                  <QuestionStatus isCorrect={isCorrect}>
                    {isCorrect ? <CheckCircle size={20} /> : <XCircle size={20} />}
                    {isCorrect ? 'Correct' : 'Incorrect'}
                  </QuestionStatus>
                </QuestionHeader>

                <AnswerDetails>
                  <AnswerItem>
                    <strong>Your Answer:</strong> {userAnswer ? `${userAnswer}. ${question.options[userAnswer]}` : 'Not answered'}
                  </AnswerItem>
                  <AnswerItem>
                    <strong>Correct Answer:</strong> {question.correctAnswer}. {question.options[question.correctAnswer]}
                  </AnswerItem>
                </AnswerDetails>

                {question.explanation && (
                  <div style={{ marginTop: '1rem', padding: '1rem', background: '#f8f9fa', borderRadius: '8px' }}>
                    <strong>Explanation:</strong> {question.explanation}
                  </div>
                )}
              </QuestionItem>
            );
          })}
        </QuestionReview>

        <ActionButtons>
          <PrimaryButton
            onClick={() => navigate('/')}
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <Home size={20} />
            Create New Quiz
