          <SecondaryButton
            onClick={() => navigate('/quiz', { 
              state: { quiz, metadata } 
            })}
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <RotateCcw size={20} />
